        <style>
            .fre-spinner-cntr {
                flex: 1;
                display: flex;
                align-items: center;
                justify-content: center;
            }
            .fre-spinner {
                width: 20px;
                height: 20px;
                border-radius: 100%;
                border: 4px solid;
                border-color: #242424 #242424 #242424 #ffffff;
                animation: fre-spinner 1s ease-in-out infinite;
            }
            .is-dark .fre-spinner,
            .is-contrast .fre-spinner {
                border-color: #ffffff #ffffff #ffffff #242424;
            }
            @keyframes fre-spinner {
                from {
                    transform: rotate(0deg);
                }
                to {
                    transform: rotate(360deg);
                }
            }
            .fre-loading {
                display: flex;
                flex-direction: column;
                height: 100%;
            }
            .fre-page-cntr {
                display: none;
                flex-direction: column;
                overflow: hidden;
                background: linear-gradient(to bottom, #dce0fa 0%, rgba(255, 255, 255, 0) 50%);
            }
            .is-dark .fre-page-cntr {
                background: linear-gradient(180deg, #3d3e78 0%, #333333 50%);
            }
            .is-contrast .fre-page-cntr {
                background: #000000;
            }
            .fre-text {
                padding: 32px;
                margin: 0 32px;
                font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            }
            .fre-text1 {
                font-size: 40px;
                font-weight: 700;
                color: #242424;
            }
            .is-dark .fre-text1,
            .is-contrast .fre-text1 {
                color: #ffffff;
            }
            .fre-text2 {
                overflow: hidden;
                font-size: 24px;
                font-weight: 600;
            }
            .fre-text2-ul {
                padding: 0;
                margin: 0;
                display: flex;
                flex-wrap: nowrap;
                flex-direction: column;
                height: 36px;
                animation: fre-text2-li calc(1.5s * 3) steps(3) infinite;
            }
            @keyframes fre-text2-li {
                0% {
                    transform: translateY(0);
                }
                100% {
                    transform: translateY(calc(3 * -100%));
                }
            }
            @keyframes fre-text2-ul {
                0% {
                    transform: translateY(0);
                }
                80%,
                100% {
                    transform: translateY(-100%);
                }
            }
            .fre-text2-li {
                list-style: none;
                flex-shrink: 0;
                width: 100%;
                height: 100%;
                -webkit-background-clip: text;
                background-clip: text;
                animation: fre-text2-ul 1.5s cubic-bezier(0.5, 0, 0.57, 1.05) infinite;
                color: transparent;
            }
            .fre-text2-color1 {
                background-image: linear-gradient(193.26deg, #8c5bd2 0%, #5b5fc7 75%, #4f52b2 100%);
            }
            .is-dark .fre-text2-color1 {
                background-image: linear-gradient(193.26deg, #fabb87 0%, #f7cf77 75%, #fad473 100%);
            }
            .fre-text2-color2 {
                background-image: linear-gradient(50.63deg, #d13b6d 0%, #d1346e 25.02%, #b830b3 100%);
            }
            .is-dark .fre-text2-color2 {
                background-image: linear-gradient(60.33deg, #fab096 0%, #faab91 25.56%, #fab187 100%);
            }
            .fre-text2-color3 {
                background-image: linear-gradient(60.33deg, #257acc 0%, #256dcc 25.56%, #705ee0 100%);
            }
            .is-dark .fre-text2-color3 {
                background-image: linear-gradient(50.63deg, #b33057 0%, #b03361 25.02%, #9e3393 100%);
            }
            .is-contrast .fre-text2-color1,
            .is-contrast .fre-text2-color2,
            .is-contrast .fre-text2-color3 {
                background-image: linear-gradient(193.26deg, #ffffff 0%, #ffffff 75%, #ffffff 100%);
            }
        </style>
